STUDIP.SupportPlugin={init:function(){$("#supportlinks").sortable({axis:"y",stop:function(){var a={};a.link_ids={};$("#supportlinks").find("div.supportlink").each(function(){a.link_ids[$(this).attr("id")]=$(this).attr("id")});var b=$("#supportlinks").data("sort-url");b=b.substring(1,b.length-1);$.ajax({type:"POST",url:b,data:a})}})},selectSearchResult:function(d,c){var a=$("#supportsearch").data("redirect-url").split("?");var b=a[0]+"/"+d;window.location.href=b}};